//SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract DynamicArray {
    uint [] grade = [1,2,3,4,5];

    function changeContent() public  {
        grade[0] = 100;
        grade[1] = 200;
    }

    function getLength() public view returns(uint) {
        return grade.length;
    }

}

